function write(stage) {

	var textA = "Ala ma KOTA";
	var textB = "1234567890-=!@#$%^&*()_+";
	var byteLenghtA = textA.length * 2;
	var byteLenghtB = textB.length * 2;
	var img = "data:image/png;base64,";


	var headerLength = 4;
	var buffer = new ArrayBuffer(headerLength + byteLenghtA + byteLenghtB);
	var view = new DataView(buffer);
	view.setUint16(0, byteLenghtA);
	view.setUint16(2, byteLenghtB);

	writeString(headerLength, view, textA);
	writeString(headerLength + byteLenghtA, view, textB);

	//var blob = new Blob([buffer]);
	//var blob = new Blob([textA, textB]);
	var data = {textA: textA, textB: textB, img: img};
	var blob = new Blob([JSON.stringify(data)], {type: "application/json"});
	saveAs(blob, "project.jup");

}

function writeString(byteOffset, view, text) {
	for (var i = 0; i < text.length; i++) {
		view.setUint16(byteOffset + i * 2, text.charCodeAt(i));
	}
}

function read(stage) {
	var input = document.getElementById("fileInput");
	input.onchange = function() {
		var reader = new FileReader();
		reader.onload = function() {
			//console.log(reader.result);
			//var texture = PIXI.Texture.fromImage(reader.result);
			//console.log(texture.baseTexture.source);
			//console.log(texture.baseTexture.imageUrl);
			//var resultImg = new PIXI.Sprite(texture);
			//stage.addChild(resultImg);

			var data = JSON.parse(reader.result);
			console.log(data.textA);
			console.log(data.textB);

			var texture = PIXI.Texture.fromImage(data.img);
			var resultImg = new PIXI.Sprite(texture);
			stage.addChild(resultImg);
		};

		//reader.readAsDataURL(input.files[0]);
		reader.readAsText(input.files[0]);
	};
}

module.exports = function(stage) {
	console.info("start writing....");
	write(stage);

	document.getElementById("fileInput").click();
	console.info("start reading....");
	read(stage);
};